    const tablePattern = /<table[^>]*>.*?<\/table>/gis;
    const tables = html.match(tablePattern);
    if (!tables || tables.length === 0) {
      console.log('‚ùå No tables found in HTML');
      return null;
    }
    console.log(`üìä Found ${tables.length} tables in HTML`);

    // Í∞Å ÌÖåÏù¥Î∏îÏóêÏÑú Îç∞Ïù¥ÌÑ∞ Ï∂îÏ∂ú
    for (let tableIndex = 0; tableIndex < tables.length; tableIndex++) {
      const table = tables[tableIndex];

      // ÌÖåÏù¥Î∏î ÌñâÎì§ Ï∂îÏ∂ú
      const rowPattern = /<tr[^>]*>.*?<\/tr>/gis;
      const rows = table.match(rowPattern);
      if (!rows || rows.length < 2) {
        continue; // Ìó§ÎçîÎßå ÏûàÍ±∞ÎÇò Îç∞Ïù¥ÌÑ∞Í∞Ä ÏóÜÎäî ÌÖåÏù¥Î∏îÏùÄ Í±¥ÎÑàÎõ∞Í∏∞
