// Trading Economics ÏõπÏÇ¨Ïù¥Ìä∏ÏóêÏÑú ÏµúÏã† Îç∞Ïù¥ÌÑ∞Î•º Í∞ÄÏ†∏Ïò§Îäî Fixed Income ÏÑúÎπÑÏä§
const BASE_URL = 'https://tradingeconomics.com';

// Fixed Income Ïã¨Î≥º Îß§Ìïë (Ï£ºÏãù APIÏôÄ ÎπÑÏä∑Ìïú Î∞©Ïãù)
const FIXED_INCOME_SYMBOLS = {
  // Í∏∞Ï§Ä Í∏àÎ¶¨
  'ÎØ∏Íµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨': 'united-states/interest-rate',
  'Ïú†Î°ú Í∏∞Ï§Ä Í∏àÎ¶¨': 'euro-area/interest-rate',
  'ÏùºÎ≥∏ Í∏∞Ï§Ä Í∏àÎ¶¨': 'japan/interest-rate',
  'ÌïúÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨': 'south-korea/interest-rate',
  'Ïä§ÏúÑÏä§ Í∏∞Ï§Ä Í∏àÎ¶¨': 'switzerland/interest-rate',
  'ÏòÅÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨': 'united-kingdom/interest-rate',
  'Ìò∏Ï£º Í∏∞Ï§Ä Í∏àÎ¶¨': 'australia/interest-rate',
  'Î∏åÎùºÏßà Í∏∞Ï§Ä Í∏àÎ¶¨': 'brazil/interest-rate',
  
  // Íµ≠Ï±Ñ ÏàòÏùµÎ•†
  'US 3M': 'united-states/3-month-bill-yield',
  'US 2Y': 'united-states/2-year-note-yield',
  'US 10Y': 'united-states/government-bond-yield',
  'US 30Y': 'united-states/30-year-bond-yield',
  'Korea 10Y': 'south-korea/government-bond-yield',
  'Japan 10Y': 'japan/government-bond-yield',
  'Germany 10Y': 'germany/government-bond-yield'
};

// ÌîÑÎ°ùÏãú ÏÑúÎ≤ÑÎì§ÏùÑ ÏÇ¨Ïö©Ìïú Ïõπ Ïä§ÌÅ¨ÎûòÌïë (Ï£ºÏãù APIÏôÄ ÎèôÏùº)
const PROXY_SERVICES = [
  'https://api.allorigins.win/raw?url=',
  'https://corsproxy.io/?',
  'https://thingproxy.freeboard.io/fetch/',
  'https://cors.bridged.cc/',
  'https://api.codetabs.com/v1/proxy?quest=',
  'https://cors.eu.org/',
  'https://cors-anywhere.herokuapp.com/',
  '' // ÏßÅÏ†ë Ìò∏Ï∂úÎèÑ ÏãúÎèÑ
];

// ÌîÑÎ°ùÏãúÎ•º ÏÇ¨Ïö©Ìïú Ïõπ Ïä§ÌÅ¨ÎûòÌïë (Ï£ºÏãù APIÏôÄ ÎèôÏùºÌïú Î∞©Ïãù)
const fetchWithProxy = async (url, proxyIndex = 0) => {
  if (proxyIndex >= PROXY_SERVICES.length) {
    throw new Error('All proxy attempts failed');
  }

  try {
    const proxyUrl = PROXY_SERVICES[proxyIndex] + url;
    console.log(`üîó Trying proxy ${proxyIndex + 1}/${PROXY_SERVICES.length}: ${proxyUrl.substring(0, 50)}...`);
    
    const response = await fetch(proxyUrl, {
      method: 'GET',
      headers: {
        'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8',
        'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36',
        'Accept-Language': 'en-US,en;q=0.9',
        'Accept-Encoding': 'gzip, deflate, br',
        'Connection': 'keep-alive',
        'Upgrade-Insecure-Requests': '1'
      },
      timeout: 10000 // 10Ï¥à ÌÉÄÏûÑÏïÑÏõÉ
    });

    if (!response.ok) {
      throw new Error(`HTTP error! status: ${response.status}`);
    }

    const html = await response.text();
    
    if (html.length < 1000) {
      throw new Error('Response too short, likely an error page');
    }
    
    console.log(`‚úÖ Proxy ${proxyIndex + 1} successful! HTML length: ${html.length} characters`);
    return html;
  } catch (error) {
    console.log(`‚ùå Proxy ${proxyIndex + 1} failed: ${error.message}`);
    return fetchWithProxy(url, proxyIndex + 1);
  }
};

// HTMLÏóêÏÑú Í∏àÎ¶¨ Îç∞Ïù¥ÌÑ∞ Ï∂îÏ∂ú (Í∞ÑÎã®ÌïòÍ≥† Ìö®Í≥ºÏ†ÅÏù∏ Î∞©Ïãù)
const extractInterestRateFromHTML = (html, title) => {
  try {
    console.log(`üîç Extracting data for ${title} from HTML...`);
    
    // Î∞©Î≤ï 1: Î™®Îì† Ïà´Ïûê.Ïà´Ïûê% Ìå®ÌÑ¥ Ï∞æÍ∏∞
    const percentagePattern = /(\d+\.\d+)%/g;
    const matches = html.match(percentagePattern);
    
    if (matches && matches.length > 0) {
      console.log(`üìä Found ${matches.length} percentage numbers for ${title}`);
      
      const rates = matches.map(match => {
        const rateMatch = match.match(/(\d+\.\d+)%/);
        return rateMatch ? parseFloat(rateMatch[1]) : 0;
      });
      
      // Ïú†Ìö®Ìïú Í∏àÎ¶¨ Î≤îÏúÑ ÌïÑÌÑ∞ÎßÅ (0.1% ~ 20%)
      const validRates = rates.filter(rate => rate >= 0.1 && rate <= 20);
      
      if (validRates.length > 0) {
        // Í∞ÄÏû• ÌÅ∞ Í∞íÏù¥ Î≥¥ÌÜµ Î©îÏù∏ Í∏àÎ¶¨
        const maxRate = Math.max(...validRates);
        console.log(`‚úÖ Found rate for ${title}: ${maxRate}%`);
        return maxRate;
      }
    }
    
    // Î∞©Î≤ï 2: ÌäπÏ†ï ÌÇ§ÏõåÎìúÏôÄ Ìï®Íªò ÏûàÎäî Í∏àÎ¶¨ Ï∞æÍ∏∞
    const keywordPatterns = [
      /interest rate.*?(\d+\.\d+)%/i,
      /(\d+\.\d+)%.*?interest rate/i,
      /yield.*?(\d+\.\d+)%/i,
      /(\d+\.\d+)%.*?yield/i,
      /bond.*?(\d+\.\d+)%/i,
      /(\d+\.\d+)%.*?bond/i,
      /rate.*?(\d+\.\d+)%/i,
      /(\d+\.\d+)%.*?rate/i
    ];
    
    for (const pattern of keywordPatterns) {
      const matches = html.match(pattern);
      if (matches && matches.length > 0) {
        const rates = matches.map(match => {
          const rateMatch = match.match(/(\d+\.\d+)%/);
          return rateMatch ? parseFloat(rateMatch[1]) : 0;
        });
        
        const validRates = rates.filter(rate => rate >= 0.1 && rate <= 20);
        if (validRates.length > 0) {
          const maxRate = Math.max(...validRates);
          console.log(`‚úÖ Found rate with keyword for ${title}: ${maxRate}%`);
          return maxRate;
        }
      }
    }
    
    // Î∞©Î≤ï 3: ÌÖåÏù¥Î∏îÏóêÏÑú Ï∞æÍ∏∞
    const tablePattern = /<table[^>]*>.*?<\/table>/gis;
    const tables = html.match(tablePattern);
    
    if (tables) {
      for (const table of tables) {
        const tableMatches = table.match(/(\d+\.\d+)%/g);
        if (tableMatches) {
          const rates = tableMatches.map(match => {
            const rateMatch = match.match(/(\d+\.\d+)%/);
            return rateMatch ? parseFloat(rateMatch[1]) : 0;
          });
          
          const validRates = rates.filter(rate => rate >= 0.1 && rate <= 20);
          if (validRates.length > 0) {
            const maxRate = Math.max(...validRates);
            console.log(`‚úÖ Found rate in table for ${title}: ${maxRate}%`);
            return maxRate;
          }
        }
      }
    }
    
    console.log(`‚ùå No valid rate found for ${title}`);
    return null;
    
  } catch (error) {
    console.error(`‚ùå Error extracting data for ${title}:`, error);
    return null;
  }
};

// 2024ÎÖÑ 12Ïõî Í∏∞Ï§Ä ÏµúÏã† ÎçîÎØ∏ Îç∞Ïù¥ÌÑ∞ (Ïã§Ï†ú ÏãúÏû• ÏÉÅÌô© Î∞òÏòÅ)
const DUMMY_FIXED_INCOME_DATA = [
