  { title: 'Ïä§ÏúÑÏä§ Í∏∞Ï§Ä Í∏àÎ¶¨', value: 1.75, change: 0.00, isPositive: true, symbol: 'SNBREFI' },
  { title: 'ÏòÅÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨', value: 5.25, change: 0.00, isPositive: true, symbol: 'BOEREFI' },
  { title: 'Ìò∏Ï£º Í∏∞Ï§Ä Í∏àÎ¶¨', value: 4.35, change: 0.00, isPositive: true, symbol: 'RBAREFI' },
  { title: 'Î∏åÎùºÏßà Í∏∞Ï§Ä Í∏àÎ¶¨', value: 12.25, change: 0.00, isPositive: true, symbol: 'BRAREFI' },
  
  // US Bond Yields - 2024ÎÖÑ 12Ïõî Í∏∞Ï§Ä ÏµúÏã† ÏàòÏùµÎ•†
  { title: 'US 3M', value: 5.45, change: 0.02, isPositive: true, symbol: 'US3M' },
  { title: 'US 2Y', value: 4.78, change: 0.05, isPositive: true, symbol: 'US2Y' },
  { title: 'US 10Y', value: 4.25, change: 0.08, isPositive: true, symbol: 'US10Y' },
