// Ïã§ÏãúÍ∞Ñ Îç∞Ïù¥ÌÑ∞ ÏãúÎÆ¨Î†àÏù¥ÏÖò (ÎçîÎØ∏ Îç∞Ïù¥ÌÑ∞Ïóê ÏïΩÍ∞ÑÏùò Î≥ÄÎèô Ï∂îÍ∞Ä)
const generateRealTimeData = () => {
  return DUMMY_FIXED_INCOME_DATA.map(item => {
    // ÏïΩÍ∞ÑÏùò ÎûúÎç§ Î≥ÄÎèô Ï∂îÍ∞Ä (¬±0.05% Î≤îÏúÑ)
    const variation = (Math.random() - 0.5) * 0.1;
    const newValue = item.value + variation;
    const newChange = variation;
    
    return {
      ...item,
      value: Math.round(newValue * 100) / 100,
      change: Math.round(newChange * 100) / 100,
      isPositive: newChange >= 0
    };
  });
};

// Í∏∞Ï§Ä Í∏àÎ¶¨ Îç∞Ïù¥ÌÑ∞ Í∞ÄÏ†∏Ïò§Í∏∞ (Ïã§ÏãúÍ∞Ñ ÏãúÎÆ¨Î†àÏù¥ÏÖò)
export const fetchInterestRates = async () => {
  try {
    // Ïã§Ï†ú API Ìò∏Ï∂ú ÎåÄÏã† Ïã§ÏãúÍ∞Ñ ÏãúÎÆ¨Î†àÏù¥ÏÖò ÏÇ¨Ïö©
    const realTimeData = generateRealTimeData();
    return realTimeData.filter(item => item.title.includes('Í∏∞Ï§Ä Í∏àÎ¶¨'));
  } catch (error) {
    console.error('Error fetching interest rates:', error);
    return DUMMY_FIXED_INCOME_DATA.filter(item => item.title.includes('Í∏∞Ï§Ä Í∏àÎ¶¨'));
  }
};

// Trading EconomicsÏóêÏÑú Í∏∞Ï§ÄÍ∏àÎ¶¨ Îç∞Ïù¥ÌÑ∞ Í∞ÄÏ†∏Ïò§Í∏∞
export const fetchInterestRatesFromTradingEconomics = async () => {
  try {
    console.log('üåê Fetching interest rates from Trading Economics...');
    
    // Trading Economics Íµ≠Í∞ÄÎ≥Ñ Í∏∞Ï§ÄÍ∏àÎ¶¨ ÌéòÏù¥ÏßÄ URL
    const url = 'https://ko.tradingeconomics.com/country-list/interest-rate';
    
    console.log(`üîó Fetching from: ${url}`);
    const html = await fetchWithProxy(url);
    
    if (!html) {
      console.log('‚ùå Failed to fetch HTML from Trading Economics');
      return null;
    }
    
    console.log(`‚úÖ HTML fetched successfully! Length: ${html.length} characters`);
    
    // HTMLÏóêÏÑú Í∏∞Ï§ÄÍ∏àÎ¶¨ Îç∞Ïù¥ÌÑ∞ Ï∂îÏ∂ú
    const interestRates = extractInterestRatesFromCountryList(html);
    
    if (interestRates && interestRates.length > 0) {
      console.log(`‚úÖ Successfully extracted ${interestRates.length} interest rates`);
      return interestRates;
    } else {
      console.log('‚ùå No interest rates found in HTML');
      return null;
    }
    
  } catch (error) {
    console.error('‚ùå Error fetching interest rates from Trading Economics:', error);
    return null;
  }
};

// Trading Economics Íµ≠Í∞ÄÎ≥Ñ Í∏∞Ï§ÄÍ∏àÎ¶¨ ÌéòÏù¥ÏßÄÏóêÏÑú Îç∞Ïù¥ÌÑ∞ Ï∂îÏ∂ú
const extractInterestRatesFromCountryList = (html) => {
  try {
    console.log('üîç Extracting interest rates from country list...');
    
    const interestRates = [];
    
    // Íµ≠Í∞ÄÎ≥Ñ Í∏∞Ï§ÄÍ∏àÎ¶¨ ÌÖåÏù¥Î∏î Ìå®ÌÑ¥ Ï∞æÍ∏∞
    // ÏùºÎ∞òÏ†ÅÏúºÎ°ú <table> ÌÉúÍ∑∏ ÏïàÏóê Íµ≠Í∞ÄÎ™ÖÍ≥º Í∏∞Ï§ÄÍ∏àÎ¶¨Í∞Ä Ìè¨Ìï®Îê®
    const tablePattern = /<table[^>]*>.*?<\/table>/gis;
    const tables = html.match(tablePattern);
    
    if (!tables || tables.length === 0) {
      console.log('‚ùå No tables found in HTML');
      return null;
    }
    
    console.log(`üìä Found ${tables.length} tables in HTML`);
    
    // Í∞Å ÌÖåÏù¥Î∏îÏóêÏÑú Îç∞Ïù¥ÌÑ∞ Ï∂îÏ∂ú
    for (let tableIndex = 0; tableIndex < tables.length; tableIndex++) {
      const table = tables[tableIndex];
      
      // ÌÖåÏù¥Î∏î ÌñâÎì§ Ï∂îÏ∂ú
      const rowPattern = /<tr[^>]*>.*?<\/tr>/gis;
      const rows = table.match(rowPattern);
      
      if (!rows || rows.length < 2) {
        continue; // Ìó§ÎçîÎßå ÏûàÍ±∞ÎÇò Îç∞Ïù¥ÌÑ∞Í∞Ä ÏóÜÎäî ÌÖåÏù¥Î∏îÏùÄ Í±¥ÎÑàÎõ∞Í∏∞
      }
      
      console.log(`üìã Processing table ${tableIndex + 1} with ${rows.length} rows`);
      
      // Ï≤´ Î≤àÏß∏ ÌñâÏùÄ Ìó§ÎçîÏù¥ÎØÄÎ°ú Ï†úÏô∏ÌïòÍ≥†, Îëê Î≤àÏß∏ ÌñâÎ∂ÄÌÑ∞ Í≤ÄÏÉâ
      for (let i = 1; i < rows.length; i++) {
        const row = rows[i];
        
        // TD ÌÉúÍ∑∏Îì§ Ï∂îÏ∂ú
        const tdPattern = /<td[^>]*>(.*?)<\/td>/gis;
        const tds = row.match(tdPattern);
        
        if (tds && tds.length >= 2) {
          // Ï≤´ Î≤àÏß∏ TD: Íµ≠Í∞ÄÎ™Ö
          const countryTD = tds[0];
          // Îëê Î≤àÏß∏ TD: Í∏∞Ï§ÄÍ∏àÎ¶¨
          const rateTD = tds[1];
          
          // Íµ≠Í∞ÄÎ™Ö Ï∂îÏ∂ú
          const countryPattern = />([^<]+)</;
          const countryMatch = countryTD.match(countryPattern);
          
          // Í∏∞Ï§ÄÍ∏àÎ¶¨ Ï∂îÏ∂ú
          const ratePattern = />([^<]+)</;
          const rateMatch = rateTD.match(ratePattern);
          
          if (countryMatch && rateMatch) {
            const country = countryMatch[1].trim();
            const rateText = rateMatch[1].trim();
            
            // Ïà´ÏûêÎßå Ï∂îÏ∂ú (ÌçºÏÑºÌä∏ Í∏∞Ìò∏ Ï†úÍ±∞)
            const numberPattern = /(\d+\.?\d*)/;
            const numberMatch = rateText.match(numberPattern);
            
            if (numberMatch) {
              const rate = parseFloat(numberMatch[1]);
              
              // Ï£ºÏöî Íµ≠Í∞ÄÎì§Îßå ÌïÑÌÑ∞ÎßÅ
              const majorCountries = {
                'ÎØ∏Íµ≠': 'ÎØ∏Íµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'United States': 'ÎØ∏Íµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Ïú†Î°ú': 'Ïú†Î°ú Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Euro Area': 'Ïú†Î°ú Í∏∞Ï§Ä Í∏àÎ¶¨',
                'ÏùºÎ≥∏': 'ÏùºÎ≥∏ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Japan': 'ÏùºÎ≥∏ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'ÌïúÍµ≠': 'ÌïúÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'South Korea': 'ÌïúÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Ïä§ÏúÑÏä§': 'Ïä§ÏúÑÏä§ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Switzerland': 'Ïä§ÏúÑÏä§ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'ÏòÅÍµ≠': 'ÏòÅÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'United Kingdom': 'ÏòÅÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Ìò∏Ï£º': 'Ìò∏Ï£º Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Australia': 'Ìò∏Ï£º Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Î∏åÎùºÏßà': 'Î∏åÎùºÏßà Í∏∞Ï§Ä Í∏àÎ¶¨',
                'Brazil': 'Î∏åÎùºÏßà Í∏∞Ï§Ä Í∏àÎ¶¨'
              };
              
              const mappedTitle = majorCountries[country];
              if (mappedTitle) {
                console.log(`‚úÖ Found ${country}: ${rate}% -> ${mappedTitle}`);
                interestRates.push({
                  title: mappedTitle,
                  value: rate,
                  change: 0.00, // Î≥ÄÌôîÏú®ÏùÄ Î≥ÑÎèÑÎ°ú Í≥ÑÏÇ∞ ÌïÑÏöî
                  isPositive: true,
                  symbol: mappedTitle.replace(' Í∏∞Ï§Ä Í∏àÎ¶¨', '').toUpperCase(),
                  isRealData: true,
                  dataSource: 'Trading Economics'
                });
              }
            }
          }
        }
      }
    }
    
    console.log(`üìä Extracted ${interestRates.length} interest rates from Trading Economics`);
    return interestRates;
    
  } catch (error) {
    console.error('‚ùå Error extracting interest rates from country list:', error);
    return null;
  }
};

