// Î™®Îì† Fixed Income Îç∞Ïù¥ÌÑ∞ Í∞ÄÏ†∏Ïò§Í∏∞ (Ï£ºÏãù APIÏôÄ ÎπÑÏä∑Ìïú Î∞©Ïãù)
export const fetchAllFixedIncomeData = async () => {
  try {
    console.log('üîÑ Fetching all Fixed Income data from Trading Economics...');
    
    const promises = [];
    
    // Î™®Îì† Fixed Income Ïã¨Î≥ºÏóê ÎåÄÌï¥ Î≥ëÎ†¨Î°ú Îç∞Ïù¥ÌÑ∞ Í∞ÄÏ†∏Ïò§Í∏∞ (Ï£ºÏãù APIÏôÄ ÎèôÏùºÌïú Î∞©Ïãù)
    for (const [title, symbol] of Object.entries(FIXED_INCOME_SYMBOLS)) {
      promises.push(
        fetchFixedIncomeQuote(title)
          .then(data => {
            console.log(`‚úÖ ${title}: ${data.value}% (${data.isRealData ? 'Real' : 'Dummy'})`);
            return data;
          })
          .catch(error => {
            console.log(`‚ùå Error fetching ${title}:`, error.message);
            // Í∞úÎ≥Ñ Ïã§Ìå® Ïãú ÎçîÎØ∏ Îç∞Ïù¥ÌÑ∞ ÏÇ¨Ïö©
            const dummyData = DUMMY_FIXED_INCOME_DATA.find(item => item.title === title);
            if (dummyData) {
              console.log(`üìä Using dummy data for ${title}`);
              return {
                ...dummyData,
                isRealData: false,
                dataSource: 'Dummy Data (Error)',
                symbol: symbol
              };
            }
            return null;
          })
      );
    }
    
    // Î™®Îì† ÏöîÏ≤≠ ÏôÑÎ£å ÎåÄÍ∏∞
    const results = await Promise.all(promises);
    
    // null Í∞í ÌïÑÌÑ∞ÎßÅ
    const validData = results.filter(data => data !== null);
    
    console.log(`‚úÖ Successfully loaded ${validData.length}/${Object.keys(FIXED_INCOME_SYMBOLS).length} Fixed Income rates`);
    
    // Ïã§Ï†ú Îç∞Ïù¥ÌÑ∞Í∞Ä ÏûàÎäîÏßÄ ÌôïÏù∏
    const realDataCount = validData.filter(item => item.isRealData).length;
    if (realDataCount === 0) {
      console.log('‚ö†Ô∏è No real data available, showing dummy data');
    } else {
      console.log(`‚úÖ ${realDataCount} real Fixed Income rates loaded`);
    }
    
    return validData;
    
  } catch (error) {
    console.error('‚ùå Error fetching all Fixed Income data:', error);
    console.log('üìä Falling back to dummy data...');
    
    // Ï†ÑÏ≤¥ Ïã§Ìå® Ïãú ÎçîÎØ∏ Îç∞Ïù¥ÌÑ∞ Î∞òÌôò
    return DUMMY_FIXED_INCOME_DATA.map(item => ({
      ...item,
      isRealData: false,
      dataSource: 'Dummy Data (Error)',
      symbol: FIXED_INCOME_SYMBOLS[item.title] || ''
    }));
  }
};

