    const html = await fetchWithProxy(url);
    const rate = extractInterestRateFromHTML(html, title);
    
    if (rate) {
      console.log(`‚úÖ Successfully fetched ${title}: ${rate}%`);
      return {
        title: title,
        value: rate,
        change: 0.00, // Î≥ÄÌôîÏú®ÏùÄ Î≥ÑÎèÑÎ°ú Í≥ÑÏÇ∞ ÌïÑÏöî
        isPositive: true,
        symbol: symbol,
        isRealData: true,
        dataSource: 'Trading Economics'
